import React from 'react';
import { DatePicker, Space } from 'antd';
import './App.scss';

function App() {

  const test = (date, dateStringte) => {
    console.log(date)
  }
  return (
    <div className="App">
      <h1>Web Personal - Cliente <span>- Jorge</span></h1>
      <h2>Proyecto</h2>
      <DatePicker onChange={test} />
    </div>
  );
}

export default App;
